        function updateChartDailyConsumption() {
            const startDate = document.getElementById('start-date-daily-consumption').value;
            const endDate = document.getElementById('end-date-daily-consumption').value;
            
            if (!startDate || !endDate) {
                alert('Por favor seleccione ambas fechas');
                return;
            }
            
            const filteredData = {};
            const dateStart = new Date(startDate + 'T00:00:00');
            const dateEnd = new Date(endDate + 'T23:59:59');
            
            for (const [key, value] of Object.entries(dataDailyConsumption)) {
                const parts = key.split('_');
                const fecha = parts.slice(1).join('_');
                const fechaObj = new Date(fecha + 'T00:00:00');
                
                if (fechaObj >= dateStart && fechaObj <= dateEnd) {
                    if (!filteredData[parts[0]]) {
                        filteredData[parts[0]] = {sum: 0, count: 0};
                    }
                    filteredData[parts[0]].sum += value;
                    filteredData[parts[0]].count += 1;
                }
            }
            
            const plotData = [];
            const clientesData = [];
            
            for (const cliente of clientesDailyConsumption) {
                if (filteredData[cliente]) {
                    const promedio = filteredData[cliente].sum / filteredData[cliente].count;
                    clientesData.push({cliente: cliente, promedio: promedio});
                }
            }
            
            clientesData.sort((a, b) => b.promedio - a.promedio);
            const top13 = clientesData.slice(0, 13);
            
            top13.forEach(item => {
                plotData.push({
                    x: [item.cliente],
                    y: [item.promedio],
                    type: 'bar',
                    name: item.cliente
                });
            });
            
            Plotly.newPlot('plotly-div-daily-consumption', plotData, {
                title: {
                    text: 'Promedio de Consumo Diario por Cliente (MWh)',
                    font: {size: 18}
                },
                xaxis: {
                    title: {
                        text: 'Cliente',
                        font: {size: 14}
                    },
                    tickangle: -45,
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true
                },
                yaxis: {
                    title: {
                        text: 'Promedio Diario (MWh)',
                        font: {size: 14}
                    },
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true
                },
                autosize: true,
                width: 1000,
                height: 600,
                showlegend: false,
